import React from 'react'
import styled from 'styled-components'
import img from '../images/sculture1.jpeg'

function Story() {
    return (
        <Storyy>
            <StoryyCtn>
                <Left>
                    <img src={img} alt="" />
                </Left>
                <Right>
                    <h2>Story</h2>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Repudiandae iusto, quis accusantium aperiam eligendi error ipsa voluptate suscipit similique? Voluptate facere harum facilis expedita deserunt quibusdam distinctio? Doloribus, dolorum similique distinctio unde aliquam sit magni repellat aliquid nihil reprehenderit quibusdam reiciendis nobis dolor nisi, illo modi ipsam amet quis omnis.</p>
                    <h1>UX/UI</h1>
                </Right>
            </StoryyCtn>
        </Storyy>
    )
}

export default Story

const Storyy = styled.div`
height: 100vh;
width: 100%;

display: flex;
flex-direction: column;
`
const StoryyCtn = styled.div`
height: 100vh;
width: 100%;

display: flex;
flex-direction: row;
`

const Right = styled.div`
width: 50%;
height: 100vh;

p {
    font-family: cursive;
    width: 80%;
}
h1 {
    margin-top: -30px;
    font-size: 170px;
    color: #DAA520;
    text-shadow: 1px 1px 1px black;
}
`
const Left = styled.div`
width: 50%;
height: 100vh;

img {
    width: 60%;
}

`
